import * as React from "react";
import { List, Datagrid, TextField } from 'react-admin';

export const UsersList = (props) => (
    <List {...props}>
        <Datagrid>
            <TextField source="id" />
            <TextField source="firstName" />
            <TextField source="email." />
        </Datagrid>
    </List>
);
